CREATE DATABASE Product;
USE Product;

-- Tạo bảng Category
CREATE TABLE Category(
	id int primary key AUTO_INCREMENT ,
    name varchar(50),
    code varchar(50),
    status int,
    description varchar(500)
);

-- Tạo bảng Product
CREATE TABLE Product(
	id int primary key AUTO_INCREMENT ,
    name varchar(50),
    price float,
    sku varchar(20),
    status int,
    description varchar(500),
    category_id int,
	FOREIGN KEY (category_id) REFERENCES Category(id)
);

-- Tạo bảng Provine
CREATE TABLE Provine(
	id int primary key AUTO_INCREMENT ,
    code varchar(50),
    name varchar(100)
);

-- Tạo bảng District
CREATE TABLE District(
	id int primary key AUTO_INCREMENT ,
    code varchar(50),
    name varchar(100)
);

-- Tạo bảng WareHouse
CREATE TABLE WareHouse(
	id int primary key AUTO_INCREMENT ,
    name varchar(100),
    address varchar(100),
    province_id int UNIQUE NOT NULL,
    status int,
    district_id int UNIQUE NOT NULL
);

-- Tạo bảng WareHouse_Product
CREATE TABLE WareHouse_Product(
	id int primary key AUTO_INCREMENT ,
    product_id int UNIQUE NOT NULL,
    warehouse_id int UNIQUE NOT NULL,
    inventory int,
    total_import int,
    total_export int,
    start_date datetime,
	expired_date datetime
);
